import React, { useState, useEffect } from 'react';
import './content.css';

// React-tabs Module
import { Tab, Tabs, TabList, TabPanel } from 'react-tabs';
import 'react-tabs/style/react-tabs.css';


//import { BarChart, CartesianGrid, XAxis, YAxis, Tooltip, Bar, Cell } from 'recharts';

function Databox() {

  let [Email, setEmail] = useState('eerokos');
  const [dataset, setDataset] = useState([]);
  let tabledata = [];


  useEffect(() => {
    getData();
  }, []);

  async function getData() {
    fetch('http://localhost:3000/' + Email)
      .then(res => {
        if (res.status === 200) {
          return res.json();
        } else {
          const error = new Error(res.error);
          throw error;
        }
      })
      .then(data => { setDataset(data); console.log(data);  })
      .then(()=>{fetchTabledata();})
      .catch(error => console.error('Error:', error))
  }

  function fetchTabledata(){
    console.log('fetching table data:' +dataset)
    tabledata = dataset.map((c, index) => {
      <tr key={c.id}>
        <td>{c.tosleep}</td>
        <td>{c.formsleep}</td>
        <td>{c.totalHours}</td>
        <td>{c.range}</td>
      </tr>
    });
  }




  return (
    <Tabs className="box">
      <TabList>
        <Tab>Array</Tab>
        <Tab>Graph</Tab>
      </TabList>

      <TabPanel>
        <table>
          <tbody>
            {tabledata}
          </tbody>
        </table>
      </TabPanel>
      <TabPanel>

      </TabPanel>
    </Tabs>
  );
}

export default Databox;
